Reducing an array of values into object with their count using aggregation framework<p>We are using MongoDB to record statistics. The approach is to record each action for an object in its own document and later aggregate them on hourly basis and store them in different collection. Sample documents are below:</p>

<pre><code>[{
    "_id" : ObjectId("5e05de1e86029610dc2c6f9c"),
    "object_type" : 1,
    "object_id" : 1003,
    "browser" : "chrome",
    "os" : "osx",
    "device" : "android",
    "category" : 3,
    "country" : "gb",
    "action" : "impression",
    "date_added" : ISODate("2019-12-26T19:00:00.000Z")
},{
    "_id" : ObjectId("5e06226586029610db417b7a"),
    "object_type" : 1,
    "object_id" : 1003,
    "browser" : "firefox",
    "os" : "osx",
    "device" : "lg_tv",
    "category" : 1,
    "country" : "pe",
    "action" : "impression",
    "date_added" : ISODate("2019-12-25T19:00:00.000Z")
},{
    "_id" : ObjectId("5e06226586029610db417b7b"),
    "object_type" : 1,
    "object_id" : 1009,
    "browser" : "uc_browser",
    "os" : "osx",
    "device" : "android",
    "category" : 4,
    "country" : "ru",
    "action" : "view",
    "date_added" : ISODate("2019-12-25T19:00:00.000Z")
}]
</code></pre>

<p>Output should be:</p>

<pre><code>[{
    "object_id": 1003,
    "object_type": 1,
    "action": "impression",
    "total": 2,
    "date": "2019-12-26 19:00:00",
    "browsers": { "firefox": 1, "chrome": 1 },
    "systems": { "osx": 2 },
    "countries": { "gb": 1, "pe": 1 },
    "devices": { "android": 1, "lg_tv": 1 },
    "categories": { "3": 1, "1": 1 }
},
{
    "object_id": 1009,
    "object_type": 1,
    "action": "view",
    "total": 1,
    "date": "2019-12-26 19:00:00",
    "browsers": { "uc_browser": 1 },
    "systems": { "osx": 1 },
    "countries": { "ru": 1 },
    "devices": { "android": 1 },
    "categories": { "4": 1 }
}]
</code></pre>

<p>Aggregation pipeline:</p>

<pre><code>[
  {
    "$match": {
      "date_added": {
        "$gte": {
          "$date": {
            "$numberLong": "1576820825000"
          }
        }
      }
    }
  },
  {
    "$group": {
      "_id": {
        "object_id": "$object_id",
        "object_type": "$object_type",
        "action": "$action",
        "date": {
          "$dateToString": {
            "format": "%Y-%m-%d %H-00-00",
            "date": "$date_added"
          }
        }
      },
      "total": {
        "$sum": 1
      },
      "countries": {
        "$push": "$country"
      }
    }
  },
  {
    "$project": {
      "action": "$_id.action",
      "object_id": "$_id.object_id",
      "object_type": "$_id.object_type",
      "date": "$_id.date",
      "total": 1,
      "countries": 1,
      "systems": 1,
      "devices": 1,
      "categories": 1,
      "_id": 0
    }
  },
  {
    "$sort": {
      "total": -1
    }
  }
]
</code></pre>

<p>This pipeline provides total of an object for a certain action on given hour and push each country into <code>countries</code> array - for readability removed other indexes from <code>$group</code>.</p>

<p>Im stuck at transforming <code>countries</code> array into desired object. Two question popped in my mind. </p>

<ol>
<li>Is it possible with single aggregation pipeline?</li>
<li>Should I just return documents using above pipeline and process rest of the indexes with scripting?</li>
</ol>

