Mongo&Express - what are the practical ways to avoid client firing same req multiple times?<p><strong>Introduction:</strong></p>

<p>I am developing a liking system similar to normal facebook liking where each user can like each post only once. I need to develop this system and have a "totalLike" in mongoDB. Environment: Mongoose, Express on server-side, Nextjs(React) on client-side.</p>

<p><strong>Problem:</strong></p>

<p>When user spams clicking the LIKE button before the button re-render to UNLIKE, the express LIKE api could be fired multiple times causing the extra number to be put into "totalLike". For example, you clicked like 3 times very fast, there you get 3 totalLikes instead of 1. (noted: I choose to add totalLike to user to avoid too many nested populate when call in the future)</p>

<p><strong>My Pseudo-code:</strong></p>

<p>Simply +1 totalLikes when press like and -1 totalLikes when press unlike. And it should be just that !</p>

<pre><code>router.patch(
  '/like/:post',
  (req, res, next) =&gt; {
     // user_id = the_user_who_click_like_to:post
     Post.updateOne( 
        // at this post, add the user_id LikedUser array, then ...
        (res) =&gt; {
             User.updateOne(
                 // at user_id, do { $inc: { totalLikes: 1 } }, &lt;-- this is the problem
                 // because "totalLikes" could be plus more than once!
)})})

router.delete(
   '/like/:post',
   // Do the same but opposite, $pull user_id from Post and -1 totalLikes in User = face same problem as above
)
</code></pre>

<p><strong>Now the questions:</strong></p>

<ol>
<li>What are the practical ways to avoid this from happening on
server-side?</li>
<li>Is blocking the client-side from firing normally done by only setting state to disabling React button ?</li>
<li>As a backend newbie, another improved approach for the shown Psuedo code would be eye candy.</li>
</ol>

