How to use element match inside condition statement of mongodb?<p>I have two orders</p>

<p>Order A:</p>

<pre><code>{
    "_id": "5e0092e725473011f4b4da54",
    "cash": 400.0,
    "deliveryFee": 5.0,
    "paymentOnPickUp" : false,
    "project": {
        "_id": "5dd3b4737908cb0cf7b40f84",
        "name": "Default Instant Deliveries"
    },
    "tasks": [{
            "tripType": "PICKUP",
            "status": "UNASSIGNED"
        },
        {
            "tripType": "DELIVERY",
            "status": "UNASSIGNED"
        }
    ]
}
</code></pre>

<p>Order B:</p>

<pre><code>{
    "_id": "5e0092e725473011f4b4da54",
    "cash": 250.0,
    "deliveryFee": 15.0,
    "paymentOnPickUp" : true,
    "project": {
        "_id": "5dd3b4737908cb0cf7b40f84",
        "name": "Default Instant Deliveries"
    },
    "tasks": [{
            "tripType": "PICKUP",
            "status": "FAILED"
        },
        {
            "tripType": "DELIVERY",
            "status": "UNASSIGNED"
        }
    ]
}
</code></pre>

<p>Now i have to get aggregated information based on project. But i only need to add cash if task on pickUp is not failed. </p>

<p>Order A has cash collection of 400 and order B has collection of 800 order B has a pick up task which is failed. So we don't need to add cash but delivery fee should be added.</p>

<pre><code>| Project                    | Cash | Delivery Fee | total Orders |
|----------------------------|------|--------------|--------------|
| Default Instant Deliveries | 400  | 20           | 2            |
</code></pre>

<p>Now following things which i tried is </p>

<pre><code>fun getProjectsSummary(): MutableList&lt;OrderSummaryDto&gt; {

        val collectionPriceCondition = ConditionalOperators.`when`(where("tasks")
                .elemMatch(where("status").`is`("FAILED"))).then(0.0).otherwiseValueOf("cash")


        val agg = Aggregation.newAggregation(
                Aggregation.project()
                        .and("cashCollection").applyCondition(collectionPriceCondition),
                Aggregation.group("project.id")
                        .sum("deliveryFee").`as`("totalDeliveryPrice")
                        .sum("cashCollection").`as`("totalCashCollection")
                        .first("project.name").`as`("projectName")
                        .count().`as`("totalOrders")
        )
        return mongoTemplate
                .aggregate(agg, "ordersCollection", OrderSummaryDto::class.java).mappedResults
    }
</code></pre>

<p>But i am inside condition i am unable to use elematch.</p>

<p>Can anyone explain me how we can achieve this????</p>

