Counting the total number of relations and mapping it to a Result<p>Given a <code>Post</code> type document as:</p>

<pre><code>@Getter
@AllArgsConstructor
class Post {
    String publisher;
    Set&lt;String&gt; interests;
}
</code></pre>

<p>From a collection of posts I am seeking to find out the <code>Set&lt;Result&gt;</code> such that the <code>Result</code> object would look like:</p>

<pre><code>@Getter
@AllArgsConstructor
class Result {
    String interestId;
    String publisherId;
    Long count;
}
</code></pre>

<hr>

<p>To  compare the operation with a <a href="/questions/tagged/java" class="post-tag" title="show questions tagged &#39;java&#39;" rel="tag">java</a> implementation, I am looking for something down the lines of the following method:</p>

<pre><code>Set&lt;Result&gt; buildQuery(List&lt;Post&gt; postList) {
    return postList.stream()
            .flatMap(post -&gt; post.getInterests().stream()
                    .map(interest -&gt; new AbstractMap.SimpleEntry&lt;&gt;(interest, post.getPublisher())))
            .collect(Collectors.groupingBy(Function.identity(), Collectors.counting()))
            .entrySet().stream()
            .map(e -&gt; new Result(e.getKey().getKey(), e.getKey().getValue(), e.getValue()))
            .collect(Collectors.toSet());
}
</code></pre>

